import React from "react";
import {
  IonSlides,
  IonSlide,
  IonCardTitle,
  IonImg,
  IonCard
} from "@ionic/react";

const SlideShow = () => {
  const slides = [
    {
      id: 0,
      url: ""
    },
    {
      id: 1,
      url: ""
    },
    {
      id: 2,
      url: ""
    },
    {
      id: 3,
      url: ""
    },
    {
      id: 4,
      url: ""
    }
  ];
  return (
    <IonSlides style={{ width: "100%", height: 200 }} >
      {slides.map(({ id, url }) => (
        <IonSlide key={id} style={{ width: "100%", height: '100%', border:'1px grey dahed' }}>
          <IonCard>
            <IonCardTitle>{id}</IonCardTitle>
            <img src={url} />
          </IonCard>
        </IonSlide>
      ))}
    </IonSlides>
  );
};

export default SlideShow;
